# Edit this file: implement solve_part1

def solve_part1(lines):
    # Parse the grid and moves
    grid_lines = []
    moves = []
    parsing_moves = False
    
    for line in lines:
        if line.strip() == "":
            parsing_moves = True
            continue
        if parsing_moves:
            moves.extend(list(line.strip()))
        else:
            grid_lines.append(line.strip())
    
    # Find robot position and create grid
    grid = [list(row) for row in grid_lines]
    rows, cols = len(grid), len(grid[0])
    
    robot_r, robot_c = -1, -1
    for r in range(rows):
        for c in range(cols):
            if grid[r][c] == '@':
                robot_r, robot_c = r, c
                break
        if robot_r != -1:
            break
    
    # Process moves
    move_dirs = {'^': (-1, 0), 'v': (1, 0), '<': (0, -1), '>': (0, 1)}
    
    for move in moves:
        dr, dc = move_dirs[move]
        nr, nc = robot_r + dr, robot_c + dc
        
        # Check what's in the way
        if grid[nr][nc] == '#':
            # Wall - can't move
            continue
        elif grid[nr][nc] == '.':
            # Empty space - move robot
            grid[robot_r][robot_c] = '.'
            grid[nr][nc] = '@'
            robot_r, robot_c = nr, nc
        elif grid[nr][nc] == 'O':
            # Box - try to push it
            # Find all boxes in the line of push
            push_positions = []
            current_r, current_c = nr, nc
            
            # Collect all consecutive boxes in this direction
            while grid[current_r][current_c] == 'O':
                push_positions.append((current_r, current_c))
                current_r += dr
                current_c += dc
                
                # Check if we've reached the end
                if current_r < 0 or current_r >= rows or current_c < 0 or current_c >= cols:
                    break
                if grid[current_r][current_c] == '#':
                    # Can't push - stop here
                    push_positions = []
                    break
            
            # If we can push all boxes, do it
            if push_positions and current_r >= 0 and current_r < rows and current_c >= 0 and current_c < cols and grid[current_r][current_c] != '#':
                # Move the last box to the empty space
                last_r, last_c = push_positions[-1]
                grid[current_r][current_c] = 'O'
                grid[last_r][last_c] = '.'
                
                # Shift all other boxes
                for i in range(len(push_positions) - 1, 0, -1):
                    from_r, from_c = push_positions[i-1]
                    to_r, to_c = push_positions[i]
                    grid[to_r][to_c] = 'O'
                    grid[from_r][from_c] = '.'
                
                # Move robot
                grid[robot_r][robot_c] = '.'
                grid[nr][nc] = '@'
                robot_r, robot_c = nr, nc
    
    # Calculate GPS coordinates sum
    gps_sum = 0
    for r in range(rows):
        for c in range(cols):
            if grid[r][c] == 'O':
                gps_sum += 100 * r + c
    
    return gps_sum

